def compute_fibonacci_function_f(A, L, R):
    m = 1000000008

    def mul(a, b):
        return [(a[0] * b[0] + a[1] * b[2]) % m, (a[0] * b[1] + a[1] * b[3]) % m, (a[2] * b[0] + a[3] * b[2]) % m, (a[2] * b[1] + a[3] * b[3]) % m]

    def f(n):
        if n == 0:
            return 0
        (v1, v2, v3) = (1, 1, 0)
        for rec in bin(n)[3:]:
            v2 = v2 % m
            v1 = v1 % m
            v3 = v3 % m
            calc = v2 * v2
            (v1, v2, v3) = (v1 * v1 + calc, (v1 + v3) * v2, calc + v3 * v3)
            if rec == '1':
                (v1, v2, v3) = (v1 + v2, v1, v2)
        return [v1 + 1, v2, v2, v3 + 1]
    s = [1, 0, 0, 1]
    for v in A[L - 1:R]:
        s = mul(s, f(v))
    return s[1] % m

